<template>
  <div id="UseTestFunctionShow">
    <div style="height: 0.5rem;"></div>
    <div style="width: 100%;height: 1rem;text-align: center">
      <span style="font-size: 0.4rem;">功能演示</span>
    </div>
    <div style="width: 100%">
      <el-card style="width: 37.041%;height:7rem;float: left;margin-left: 1rem;">
          <div class="photoDisplay" style="width: 94%;height:40%;margin-left: auto;margin-right: auto;margin-top:0.2rem;">
            <span style="font-size: 0.2rem;text-align: left">选择图片：</span>
            <div style="height: 0.05rem"></div>
           <el-card style="text-align: center;height: 2.7rem;">
            <img :src="imgURLSelect"style="max-width: 100%"/>
           </el-card>
          </div>
        <div class="example" style="margin-top: 0.3rem;width: 94%;margin-left: auto;margin-right: auto">
          <span style="font-size: 0.2rem;">图片示例：</span>
        </div>
          <div class="photoSelect" style="width: 94%;height: 27%;margin-left: auto;margin-right: auto;overflow-x: scroll;overflow-y: hidden;overflow-wrap: normal;white-space: nowrap;">
            <div style="height: 0.1rem;"></div>
            <el-row :gutter="20" style="width: 9rem;">
              <el-col style="height: 1.50rem;width:1.50rem;" v-for="(item,index) in image" :key="index">
                <el-card style="width: 1.40rem;height: 1.48rem;">
                <img :src="item.src" @click='selectPhoto(item)' style="width: 100%;"/>
                </el-card>
              </el-col>
            </el-row>
          </div>
          <div style="height: 0.2rem;"></div>
          <div style="height: 15%;width: 100%;">
            <el-row>
              <el-col>
                <!--<div style="width: 100%">-->
                  <!--<el-input class="input11" placeholder="请输入图片的URL" v-model="inputUrl" style="width: 60%;float: left"></el-input>-->
                  <!--<el-button style="margin-left: 0.2rem">检测图片</el-button>-->
                <!--</div>-->
                <div style="height: 0.2rem"></div>
                <div style="float: left">
                   <a  class="file">选择文件
                    <input id="input"  ref="uploadImg" type="file" accept="image/*" @change="UploadIMG($event)">
                  </a>
                </div>
              </el-col>
            </el-row>
          </div>
      </el-card>
      <div style="width: 37.041%;float: right;margin-right: 2rem">
        <el-tabs type="border-card">
          <el-tab-pane label="JSON"style="font-size: 0.20rem;">
            {{json}}
          </el-tab-pane>
        </el-tabs>
      </div>
    </div>

  </div>
</template>

<script>



export default {
  name: 'UseTestFunctionShow',
  data(){
    return{
      json:null,
      inputUrl:'',
      imgURL:'',
      imgURLSelect:require('./image/plate (2).jpg'),
      image:[
        {src:require('./image/plate (2).jpg'),base64:''},
        {src:require('./image/plate (4).jpg'),base64:''},
        {src:require('./image/plate (6).jpg'),base64:''},
        {src:require('./image/plate (7).jpg'),base64:''},
        {src:require('./image/plate (8).jpg'),base64:''},
        {src:require('./image/plate (10).jpg'),base64:''},
      ],
      test:{
        image:'dafafkjke213nfnjdnonon12onoi421n4o',
        userCode: '13688980285'
      }
    }
  },
  methods:{
    UploadIMG(){
      var _this = this;
      var showFile = event.target.files[0];
      var reader = new FileReader();
      reader.readAsDataURL(showFile); // 读出 base64
      reader.onloadend = function () {
        var keyy=reader.result.split(',');
        _this.$data.imgURLSelect='data:image/jpg;base64,'+keyy[1]
        _this.$data.reImg=keyy[1];
        _this.fun();
      };


    },
    fun(){
      let _this=this;
      this.$axios({
        method:'post',
        url:'http://47.94.242.44:8081/plate_recognition',
        data:{
          image:_this.$data.reImg,
        }
      }).then(function (res) {
        _this.$data.json = res.data;
      })
    },
    selectPhoto(item){
      this.$data.imgURLSelect=item.src;
      let _this=this;

      this.$axios({
        method:'post',
        url:'http://47.94.242.44:8081/plate_recognition',
        data:{
          image:item.base64
        }
      }).then(function (response) {
        _this.$data.json=response.data
      })

    },
  },

}
</script>

